import logo from '../assets/images/logo.png';
import apple from '../assets/icons/apple-logo.svg';
import android from '../assets/icons/android-logo.svg';
import cup from '../assets/images/hero-1.png';
import mobile from '../assets/images/hero-2.png';

const Hero = () => {
    return (
        <section className="hero position-relative h-screen">
            <div className="container w-1/2">
                <img src={logo} className="hero-logo w-[65px]" alt="logo" />
                <h1 className="font-bold">Budi fit uz lični plan ishrane bez striktnih dijeta, odricanja i gladovanja</h1>
                <h3>Fity je <strong>mobilna aplikacija</strong> koja ti omogućava da kreiraš i pratiš plan ishrane prema tvojim ciljevima po ceni od <strong>490 RSD mesečno.</strong></h3>
                <ul>
                    <li>Brzi, zdravi i ukusni obroci</li>
                    <li>Automatska šoping lista namirnica</li>
                    <li>Lako praćenje plana, kalorija i napretka</li>
                    <li>Sloboda izbora namirnica</li>
                </ul>
                <button>Prijavi se na listu čekanja
                <img src="../assets/icons/ring-icon.svg" alt="ring icon" />
                </button>
                <div className="flex gap-4 items-center">
                    <p>Uskoro dostupno za android i IOS uređaje</p>
                    <img src={apple} alt="apple" className="w-[50]"/>
                    <img src={android} alt="android" />
                </div>
            </div>
            <img src={cup} alt="cup" className="cup-hero absolute w-[400px] top-0 right-1/4" />
            <img src={mobile} alt="mobile" className="mobile-hero absolute w-1/3 bottom-0 right-0" />
        </section>
    );
};

export default Hero;
